var requestOptions = {
  method: 'GET',
  redirect: 'follow'
};

fetch('http://govqueue-api.onrender.com/agencies/13', requestOptions)
  .then(response => response.text())
  .then(result => console.log(result))
  .catch(error => console.log('error', error));

